import React, {Component} from 'react';
import ListToggle from '../../components/ListToggle';



class Item extends Component {
    render() {
        return (<div className={'item'}>
            <h1>When they see us</h1>
            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed dictum est sed consequat pellentesque. Morbi
                fringilla justo tortor, ut pharetra ante fermentum ut. Vestibulum ante ipsum primis in faucibus orci
                luctus et ultrices posuere cubilia Curae; Etiam vel lobortis dui, id fringilla lectus. Phasellus quis
                venenatis velit. Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia Curae;
                Nunc sed dapibus est, nec mollis leo.</p>

        </div>);
    }
}

export default Item;
